// Dynamic LLM routing logic based on cost/performance
const inputData = $input.item.json.input_data;
const taskType = $input.item.json.task_type;
const priority = $input.item.json.priority;

// Calculate complexity score
const dataLength = inputData.length;
let complexityScore = 0;

if (dataLength < 500) complexityScore = 1;
else if (dataLength < 2000) complexityScore = 2;
else complexityScore = 3;

// Routing decision matrix
let selectedProvider = '';
let modelName = '';
let estimatedCost = 0;
let expectedQuality = 0;

if (priority === 'cost') {
  // Prioritize low-cost providers
  if (complexityScore === 1) {
    selectedProvider = 'groq';
    modelName = 'llama-3.1-8b-instant';
    estimatedCost = 0.0001;
    expectedQuality = 7;
  } else if (complexityScore === 2) {
    selectedProvider = 'ollama';
    modelName = 'llama3';
    estimatedCost = 0;
    expectedQuality = 6;
  } else {
    selectedProvider = 'groq';
    modelName = 'llama-3.1-70b-versatile';
    estimatedCost = 0.0005;
    expectedQuality = 8;
  }
} else if (priority === 'performance') {
  // Prioritize high-quality providers
  if (complexityScore === 1) {
    selectedProvider = 'openai';
    modelName = 'gpt-4o-mini';
    estimatedCost = 0.002;
    expectedQuality = 9;
  } else if (complexityScore === 2) {
    selectedProvider = 'anthropic';
    modelName = 'claude-3-5-sonnet-20241022';
    estimatedCost = 0.015;
    expectedQuality = 10;
  } else {
    selectedProvider = 'openai';
    modelName = 'gpt-4o';
    estimatedCost = 0.025;
    expectedQuality = 10;
  }
} else {
  // Balanced approach
  if (complexityScore === 1) {
    selectedProvider = 'groq';
    modelName = 'llama-3.1-8b-instant';
    estimatedCost = 0.0001;
    expectedQuality = 7;
  } else if (complexityScore === 2) {
    selectedProvider = 'openai';
    modelName = 'gpt-4o-mini';
    estimatedCost = 0.002;
    expectedQuality = 9;
  } else {
    selectedProvider = 'anthropic';
    modelName = 'claude-3-5-sonnet-20241022';
    estimatedCost = 0.015;
    expectedQuality = 10;
  }
}

return {
  input_data: inputData,
  task_type: taskType,
  priority: priority,
  routing_decision: {
    provider: selectedProvider,
    model: modelName,
    complexity_score: complexityScore,
    estimated_cost: estimatedCost,
    expected_quality: expectedQuality
  },
  timestamp: new Date().toISOString()
};

// Calculate actual performance metrics
const startTime = new Date($input.first().json.timestamp).getTime();
const endTime = Date.now();
const processingTime = endTime - startTime;

const routingDecision = $input.first().json.routing_decision;
const aiResponse = $input.all()[1].json;

// Extract quality score from AI response
let actualQuality = 0;
try {
  actualQuality = aiResponse.quality_score || routingDecision.expected_quality;
} catch (e) {
  actualQuality = routingDecision.expected_quality;
}

// Performance evaluation
const costEfficiency = (actualQuality / routingDecision.estimated_cost).toFixed(2);
const performanceScore = ((actualQuality / 10) * 0.7 + (1 / (processingTime / 1000)) * 0.3).toFixed(2);

return {
  original_input: $input.first().json.input_data,
  task_type: $input.first().json.task_type,
  priority: $input.first().json.priority,
  routing_decision: routingDecision,
  enriched_data: aiResponse,
  performance_metrics: {
    processing_time_ms: processingTime,
    actual_quality_score: actualQuality,
    expected_quality_score: routingDecision.expected_quality,
    estimated_cost: routingDecision.estimated_cost,
    cost_efficiency: parseFloat(costEfficiency),
    performance_score: parseFloat(performanceScore),
    provider_used: routingDecision.provider,
    model_used: routingDecision.model
  },
  timestamp: new Date().toISOString()
};
